import React, {Component} from "react";
import RenderTodoList from "./RenderTodoList.js"
import RenderTodoInput from "./RenderTodoInput.js";
class Todolist extends Component{
    constructor(props){
      super(props);
      this.selector =1;
      this.state={
        contents:[],
      }
    }

    changeMode(){
      console.log("befor call "  + this.selector);
      this.selector = this.selector+1;
      console.log(this.selector);
      console.log(this.state.contents[this.selector-1]);
      return;
    }



    render(){
      return(
        <div>
          <RenderTodoList contentsData={this.state.contents}></RenderTodoList>
          <RenderTodoInput contentsList = {this.state.contents} updateContents={function(updatelist){
            this.setState({
              contents : updatelist
            })
          }.bind(this)}></RenderTodoInput>
          {this.changeMode()}
        </div>

      );
    }
  }

  export default Todolist;
